INSERT INTO `scriptvals` VALUES ('textstrings','"{\"block\":[\"block\",\"Button next to the result title to call up the block dialog\"],\"unblock\":[\"Unblock\",\"Green button in results to remove a site from the block list\"],\"onetime\":[\"Show Hit\",\"Yellow button in results to show a result temporarily\"],\"pban\":[\"Perma-ban\",\"Red button to move a site to the perma-ban list\"],\"shownotc\":[\"Show Notices\",\"Button to set the preference for notices to show them\"],\"hidenotc\":[\"Hide Notices\",\"Button to set the preference for notices to hide them\"],\"okbtn\":[\"Block Site\",\"Button in the block dialog to block the selected domain\"],\"cancelbtn\":[\"Cancel\",\"Button in the block dialog to cancel out with making changes\"],\"savebtn\":[\"Save Lists\",\"Button in the management pane to update the block and perma-ban lists\"],\"closebtn\":[\"Close\",\"Button in the management pane to close the pane\"],\"okPbtn\":[\"Perma-ban\",\"Button in the block dialog to perma-ban the selected domain\"],\"cancelMbtn\":[\"Manage Hiding\",\"Button in the block dialog to open the management pane\"],\"mngbtn\":[\"Manage Hiding\",\"Button on the right side to open the management pane\"],\"eximbtn\":[\"Export\",\"Button in the management pane to export the block list\"],\"utilbtn\":[\"List Util\",\"Button in the management pane to open the utility panel\"],\"sortbtn\":[\"Sort\",\"Button in the management pane to sort the block list\"],\"unwwwbtn\":[\"Un-www\",\"Button in the management pane to strip www from blocked domains\"],\"dedupbtn\":[\"De-Dup\",\"Button in the management pane to de-duplicate the block list\"],\"impobtn\":[\"Import\",\"Button in the management pane to import domains into the block list\"],\"sharebtn\":[\"Share\",\"Button in the management pane to post block list to the web\"]}"');
